                if (!this.monitors || !this.monitors.length) return;
                let rtn = { infoTitle: '', infoBody: '', offset: [0, 0] }; // 需要返回的SimpleInfoWindow对象
                // 根据点击的位置id，获取位置对象
                let cur = null, tit = [], con = [];
                this.monitors.some(v => {
                    if (v.id === obj.id) {
                        cur = v;
                        return true;
                    }
                });

                // 根据位置对象生成SimpleInfoWindow对象
                if (cur) {
                    tit.push(`<i class="icon icon-capacity-manage"></i>`);
                    tit.push(`<div class="tit-con">`);
                    tit.push(`<p>${cur.p}</p>`);
                    tit.push(`<p>司机：${cur.d || '未知'}</p>`);
                    tit.push(`</div>`);
                    con.push(`<p>车牌号：${cur.p}</p>`);
                    con.push(`<p>物流公司：${cur.c}</p>`);
                    con.push(`<p>车辆监控状态：${this.convertMs(cur.ms)}</p>`);
                    con.push(`<p>轿运车状态：${this.convertTs(cur.ts)}</p>`);
                    con.push(`<p>当前位置：${obj.location}</p>`);
                    con.push(`<p>定位时间：${cur.t}</p>`);
                    con.push(`<p><a href="javascript:;" class="btn" onclick="positioning('${cur.p}')">定位</a></p>`);
                }

                rtn.infoTitle = tit.join('');
                rtn.infoBody = con.join('');
                return Promise.resolve(rtn);
            },
            convertMs (ms) { // 监控状态
                if (ms && ms[0] === '0') return `行驶中，${ms[1]}km/h`;
                else if (ms && ms[0] === '1') return '静止';
                else if (ms && ms[0] === '2') return '离线';
                else return ms;
            },
            convertTs (ts) { // 运输状态
                if (ts === '10') return '空载';
                else if (ts === '20') return '未满载';
                else if (ts === '30') return '满载';
                else if (ts === '40') return '忙碌';
                else return '未知';
            },
            convertErrorType (t) { // 异常上报类型
                if (t === '1') return '交通事故';
                else if (t === '2') return '堵车';
                else if (t === '3') return '扣车';
                else if (t === '4') return '恶略天气';
                else if (t === '5') return '板车故障';
                else return '其他';
            }

        }
    };
</script>

